  "91ff22cfdfae4000a6d9": "PCI DSS (Payment Card Industry Data Security Standard) est la norme de sécurité de l'industrie des cartes de paiement. Développée par de grandes organisations de cartes de crédit telles que Visa, MasterCard et American Express, la norme PCI DSS vise à protéger les données des titulaires de cartes et à prévenir la fraude par carte de crédit, le piratage et les vulnérabilités de sécurité.\n\nLa norme PCI DSS se compose de 12 exigences de sécurité de base qui englobent la sécurité du réseau, la protection des données, la gestion des vulnérabilités, le contrôle d'accès, la surveillance du réseau et les politiques de sécurité de l'information. Tous les commerçants et fournisseurs de services qui traitent, stockent ou transmettent des informations de carte de crédit doivent se conformer à ces normes.\n\n{brandName} est certifié par la PCI, ce qui démontre que ses mesures de sécurité des données sont conformes aux normes internationalement reconnues. Cette certification garantit la protection efficace des informations de carte de crédit des clients et d'autres données sensibles contre les violations et la fraude.",
  "91xXw22xZhCYxYVeDdhx4i": "Nombre maximal de fichiers importés : {num}.",
  "92eq8vZsMSwqhGko8WYXAy": "Dépôt",
  "93515e63f9a64000a1f4": "Sécurité DNS",
  "93KEpBLkX7fLmtuwVAmBrC": "Quitte l'intervalle cible",
  "93RVzcYHsLpzdLqoXhjq1b": "<span>Prise en charge limitée et vulnérabilité aux erreurs :</span> les portefeuilles Web3 ne disposent généralement pas d’un support client dédié et sont sujets aux erreurs des utilisateurs, telles que l’envoi de fonds à la mauvaise adresse. Ils manquent également souvent de services directs de conversion de fiat en crypto.",
  "93a9284459b84000a20f": "APR max : {apr}",
  "93bamwKq383WFycaKTMQEd": "Les comptes ne peuvent pas être fusionnés après leur suppression. Si vous souhaitez fusionner des comptes, contactez le <a href='{a}' target='_blank' rel='noopener noreferrer'>service client</a>.",
  "94HZ4AG61AYiY8N7PidjXH": "Lorsque vous faites du copy trading de cryptomonnaies, vous devez toujours être conscient des risques systématiques qui affectent l’ensemble du marché, tels que les changements réglementaires ou les événements mondiaux majeurs. Ces facteurs peuvent avoir un impact sur toutes les cryptos, y compris celles de votre portefeuille. En reflétant les stratégies d’une autre personne, vous n’êtes pas seulement exposé à des risques de prise de décision, mais aussi à des dynamiques de marché plus larges. Par exemple, un changement soudain de réglementation ou un problème important avec une grande plateforme d’échange de cryptos pourrait grandement affecter les conditions du marché, ce qui aurait un impact sur vos investissements. Il est donc important de diversifier votre portefeuille et vos stratégies de trading pour répartir le risque.",
  "969274b779d14000ab7b": "Sauvegardes et restauration des données",
  "96ae3df671f24000ab05": "{brandName} utilise des algorithmes de cryptage puissants et soigneusement sélectionnés pour s’assurer que toutes les communications sont protégées contre l’écoute ou la falsification non autorisée par des tiers. Cela inclut des algorithmes d’échange de clés qui prennent en charge la confidentialité persistante, tels que l'ECDHE (Échange de clés Diffie-Hellman basé sur les courbes elliptiques), et des algorithmes de chiffrement symétrique tels que l'AES (Norme de chiffrement avancée) et le ChaCha20. Ces algorithmes sont mondialement reconnus pour leur sécurité éprouvée dans le temps.\n\n{brandName} surveille et met à jour en permanence ses mesures de sécurité pour faire face à l’évolution des cybermenaces. Nos audits de sécurité réguliers garantissent que nos pratiques de sécurité respectent ou dépassent les normes de l’industrie. La sécurité de nos utilisateurs est notre priorité absolue, et {brandName} s’engage à fournir un environnement de trading sûr et pratique. Votre confiance est la force motrice des progrès toujours croissants de {brandName}.",
  "96oo8Yq5o389Qt4hNRmqty": "Modifier l'ordre",
  "9714bcf9f64d4000a55b": "Notre équipe de réponse aux incidents gère les problèmes de sécurité 24 h/24 et 7 j/7 avec des procédures bien établies. Nous anticipons les problèmes potentiels, réagissons immédiatement et effectuons des examens post-incident pour garantir des interventions d’urgence efficaces.",
  "97rDn5c8r9axPurnUZSTRp": "Capitalisez sur les cycles de halving du Bitcoin avec {brandName}. Que vous achetiez ou vendiez du Bitcoin sur le marché spot, que vous soyez long ou short sur le Bitcoin en tirant parti de sa volatilité, ou que vous choisissiez de gagner un revenu passif sur vos bitcoins inactifs, la plateforme robuste de {brandName} garantit une expérience de trading sécurisée sur les marchés.",
  "98acee1e18524000af2e": "{brandName} a établi des protocoles de sécurité détaillés pour les connexions API, l’authentification, la protection des données, la validation des entrées/sorties et la limitation du débit.",
  "98hKFZudY7idarYUXkajXf": "Preuve d'enjeu (PoS) d'Ethereum",
  "99b947d9491d4000a5c7": "Détection des plugins malveillants",
  "99f11beaaa364000a3d8": "Simulations régulières d’incidents de sécurité pour tester les capacités de réponse de chacun, y compris, mais sans s’y limiter, des tests de phishing, des exercices de réponse aux incidents et des exercices d'équipe rouge.",
  "99k7WVk3eymfiacNiM2JLv": "<span>Clé publique :</span> votre <a href='{url}' target='_blank'>clé publique</a> est semblable à l'adresse de votre portefeuille. Vous pouvez la partager pour recevoir des fonds ou utiliser des applications décentralisées (<a href='{dappsurl}' target='_blank'>dapps</a>). Elle est générée à partir de la clé privée, mais ne peut pas révéler votre <a href='{url2}' target='_blank'>clé privée</a>.",
