  "9Vg9Ye1NshSRtk2XPYyH3c": "Vous pouvez consulter les statistiques du pool de minage en visitant le site internet du pool et en accédant à son tableau de bord. Ce tableau fournit des informations sur vos taux de hachage, vos gains et d'autres statistiques pertinentes.",
  "9XxwPW34ksQYeK78wJEaUL": "Ajouter le contact",
  "9YRzfJQkHpD1ADcF5vJd2h": "Motif de gel des actifs en attente. Nous vous tiendrons au courant bientôt.",
  "9b49625b13694000aa6f": "Le système de sécurité de compte de {brandName} se compose de deux parties : la vérification et le contrôle des risques. Notre protocole de contrôle des risques déploie des stratégies anti-hameçonnage pour plusieurs scénarios tels que les connexions, les retraits et les modifications des paramètres de sécurité. Il évalue les appareils des utilisateurs, les adresses IP et le comportement passé pour évaluer les risques. Si un risque est détecté, des étapes de vérification supplémentaires sont lancées en fonction du scénario spécifique pour assurer la sécurité des comptes.",
  "9bb956f7b7d74000a302": "Gestion des ID d’appareil",
  "9bedd0200f824000a39c": "{brandName} dispose d’une plateforme unifiée pour gérer et analyser les logs d’opérations et de sécurité. Cela garantit que tous les comportements et activités sont enregistrés de manière immuable pour répondre aux exigences réglementaires, permettre la surveillance, soutenir les enquêtes et assurer la traçabilité.",
