  "9vJtKFry8Q1xpq2TjbPG4x": "Dépendre uniquement de traders copiés pour vos investissements dans les cryptos peut être risqué. Leurs stratégies peuvent ne pas correspondre à votre tolérance au risque et à vos objectifs. Certains peuvent également avoir des incitations (telles que des avantages ou des frais de trading moins élevés) qui les amènent à donner la priorité à l’acquisition d’abonnés plutôt qu’à des pratiques de trading durables et à long terme qui conviennent à vos objectifs financiers.",
  "9vZMJ91Rea72iuDjqm7zrD": "Ordres TWAP",
  "9ybg8nNsJNUCDkcPwV8ncf": "La création d’un portefeuille Web3 est un processus simple. Voici un guide étape par étape pour vous aider à configurer votre propre portefeuille Web3 :",
