  "a3ad8ebe7d904000af8e": "Lorsque les utilisateurs créent une API ou accèdent à la page de gestion des API, les retraits ne peuvent être effectués qu’à partir de l’adresse IP de l’utilisateur et des adresses de retrait spécifiées. Cela réduit efficacement le risque de faille de sécurité en cas de fuite ou de perte d’une clé API.",
