  "a6QD5WPJNKRezS4vxBbsHb": "Réseau de dépôt:",
  "a775e0c384f34000a3a8": "{brandName} met en œuvre la séparation des autorisations pour les indicateurs clés de performance des utilisateurs, y compris les autorisations générales, les transactions au comptant, sur marge et les contrats futures. Différents niveaux d’autorisation correspondent à différentes opérations, ce qui empêche les actions d’autorisation croisée. Pour modifier les autorisations, les utilisateurs doivent d’abord se connecter à leurs comptes, garantissant ainsi la sécurité de leurs fonds.",
  "a7P3fAoqk4dH8uaFvzj6Kq": "Minimum : {rate}",
  "a840f10cc4cf4000a46e": "Clés API et séparation des comptes",
  "a8TpUFNDSYShm4cRjT5y1b": "En savoir plus",
  "a8c95b5ee1ea4000aebf": "La protection de la confidentialité des données des utilisateurs est notre priorité absolue. {brandName} utilise des mesures de sécurité avancées pour garantir la confidentialité des données et empêcher tout accès non autorisé. Les données sensibles, y compris les mots de passe, les clés de transaction et les informations d'identification personnelle, sont protégées par les mesures les plus strictes. Ces données sont traitées à l'aide de méthodes de zero-knowledge proofs, ce qui garantit que même la plateforme ne peut pas accéder à ces informations sans l'autorisation explicite de l'utilisateur. De plus, toutes les données sensibles sont cryptées à l'aide d'algorithmes de cryptage avancés pour renforcer encore la sécurité.\n\nLa plateforme utilise des systèmes de base de données dédiés spécialement conçus pour stocker des informations sensibles, offrant ainsi une couche de sécurité supplémentaire. En tant que telles, ces bases de données fonctionnent dans des environnements de réseau interne étroitement contrôlés. Les méthodes de conteneurisation garantissent ensuite que chaque service s'exécute dans un conteneur distinct, ce qui permet de séparer les services grâce à un certain niveau d'isolation. Cette approche garantit que même au sein de la plateforme, les services ne peuvent pas accéder à des données sensibles. La sécurité des données de cette manière permet ainsi de maintenir la plateforme stable et scalable.",
  "a8oyZqZr6dz72wSfrpqKCc": "Basique",
  "a9b72c3a46494000a10c": "1. Nous collaborons avec des institutions agréées et mettons régulièrement des fonds en commun sur des comptes bancaires institutionnels fiables pour assurer la sécurité des fonds des utilisateurs.\n2. Vérifions que le nom du compte du déposant correspond au compte de l’utilisateur pour éviter les risques de fraude et de conformité.\n3. Vérifions que le nom du compte du destinataire correspond au compte de l’utilisateur pour les retraits afin de prévenir les risques de fraude et de conformité.\n4. Toutes les transactions de dépôt et de retrait nécessitent la réalisation d’une vérification avancée KYC (Know Your Customer).",
  "a9dae303ab5e4000a56d": "Les mots de passe et autres données sensibles sont inaccessibles sans l'autorisation explicite de l'utilisateur. {brandName} utilise une authentification stricte pour toutes les demandes internes, garantissant que seuls les services autorisés peuvent échanger des données. Le contrôle d'accès basé sur les rôles (RBAC) limite l'accès aux données sensibles pour les opérations nécessaires, empêchant même les utilisateurs et les services autorisés de dépasser leurs autorisations.\n\nPour plus de sécurité, nous effectuons régulièrement des audits de sécurité et des analyses de vulnérabilité pour nous assurer que tous les systèmes sont conformes aux dernières normes et aux meilleures pratiques. L'équipe de sécurité de {brandName} surveille de près les menaces émergentes et réagit rapidement à tout incident potentiel. Enfin, les employés reçoivent régulièrement une formation en matière de sécurité pour maintenir les meilleures pratiques de sécurité.\n\nComme votre confiance est primordiale pour nous, {brandName} s'engage à protéger la confidentialité et la sécurité des données des utilisateurs. Nous améliorons constamment nos mesures de sécurité pour mieux nous prémunir contre les cybermenaces de plus en plus sophistiquées. Ces mesures visent à fournir un environnement de trading sécurisé, permettant à nos utilisateurs de trader en toute confiance et en toute sécurité.",
