  "aboutus.about": "À propos de nous",
  "aboutus.community": "Communauté",
  "aboutus.feature1": "Produits axés sur la technologie",
  "aboutus.feature1.intro": "Nous utilisons les technologies de pointe pour créer des services pratiques pour tous, pour que davantage de personnes aient accès aux merveilles de la blockchain.",
  "aboutus.feature2": "Une communauté ouverte à tous",
  "aboutus.feature2.intro": "Nous sommes une plateforme d'échange faite de gens, pour les gens et par les gens. Nous créons une communauté {brandName} accessible à tous, où n'importe qui peut exprimer son opinion et grandir.",
  "aboutus.feature3": "KCS ouvre les portes de l'écosystème {brandName}.",
  "aboutus.feature3.intro": "Nous développons un écosystème autour du jeton {brandName} (KCS), qui sera votre guide au sein d'un univers décentralisé prospère construit conjointement par tous les membres de la communauté {brandName}.",
  "aboutus.press": "Press",
  "aboutus.story": "Notre histoire",
  "aboutus.story.intro": "{brandName} est l'œuvre de deux passionnés de technologie qui ont été parmi les premiers à adopter la blockchain. Après avoir commencé à coder à l'âge de 8 ans et fondé sa première startup à l'âge de 16 ans, Michael a entendu parler du Bitcoin en 2012 de la bouche de son patron Eric et il s'est immédiatement lancé dans le minage. Alors qu'il tentait de vendre quelques BTC sur Mt. Gox, il s'est rendu compte que ce qui était la plus grande plateforme du monde à l'époque était difficile à utiliser pour les débutants. Tandis que la blockchain gagnait du terrain, Michael et Eric ont réalisé qu'elle était en train de remodeler le système financier. Elle créait un nouveau système qui ne servait pas seulement les intérêts des quelques personnes les plus riches, mais aussi ceux de tout le monde, y compris les personnes sans diplôme, sans emploi et non bancarisées. À la fin de 2013, ils ont écrit le premier code dans un café. Ainsi commençait l'aventure de l'Exchange du Peuple visant à permettre à tout le monde de se lancer dans la crypto.",
  "aboutus.ten.item1": "Suivre le marché financier et gérer les risques",
  "aboutus.ten.item10": "Être professionnel et faire preuve de maturité",
  "aboutus.ten.item2": "Une approche orientée vers l'l'utilisateur et l'entreprise",
  "aboutus.ten.item3": "Fixer des objectifs ambitieux et orienter sagement ses efforts",
  "aboutus.ten.item4": "Maximiser les revenus et rentabiliser chaque centime",
  "aboutus.ten.item5": "Être maître des résultats grâce à une approche axée sur les données",
  "aboutus.ten.item6": "Accepter les défis et réagir rapidement aux changements",
  "aboutus.ten.item7": "S'engager dans une collaboration productive pour des résultats avantageux à tous",
  "aboutus.ten.item8": "Une communication claire et franche",
  "aboutus.ten.item9": "Affronter les défis tête haute",
  "aboutus.ten.title": "Les dix principes de {brandName}",
  "aboutus.title": "Notre mission est de faciliter la circulation <br/> de la valeur numérique à travers le monde entier",
  "aboutus.title.intro": "Chez {brandName}, nous pensons que le progrès technologique va révolutionner la façon dont nous créons et distribuons la valeur. Le jour viendra où les cryptomonnaies seront l'affaire de tous.",
  "aboutus.top1.title": "N° 1",
  "aboutus.top1.value": "En termes de mondialisation",
  "aboutus.trend.item1.intro": "- Mise à jour du contrat intelligent de KCS<br/>- {brandName} lance le bot de trading 1.0<br/>- Déploiement de {brandName} ETF<br/>- Mise à jour de {brandName} Matching Engine.",
