  "as1BsgsURUCW6mTPrEtiv8": "Compte",
  "asset.debts": "Liabilities",
  "asset.faq.answer.one": "Le compte de financement est utilisé pour les dépôts et les retraits de cryptomonnaies, les achats par carte de crédit / débit et les prêts sur marge. Le compte de trading est utilisé pour le trading de cryptomonnaies. Le compte sur marge est utilisé pour les emprunts sur marge et le trading. Le compte de futures est utilisé pour le trading de futures. Le compte financier est utilisé pour le staking et la gestion financière, avec un rendement annuel pouvant atteindre jusqu’à 20 %.",
  "asset.faq.answer.oneNew": "Le compte de financement est utilisé pour les dépôts et les retraits de cryptomonnaies, les achats par carte de crédit / débit et les prêts sur marge. Le compte de trading est utilisé pour le trading de cryptomonnaies. Le compte sur marge est utilisé pour les emprunts sur marge et le trading. Le compte de futures est utilisé pour le trading de futures. Le compte financier est utilisé pour le staking et la gestion financière, avec un rendement annuel pouvant atteindre jusqu’à 20 %.",
  "asset.faq.answer.two": "Les prêts font référence au montant de crypto prêté depuis le compte de financement pour le marché sur marge. Les dettes font référence au montant de crypto emprunté avec le compte sur marge pour le marché sur marge. Les dettes et les prêts sont inclus dans la valeur estimée de votre compte. Remarque : les prêts ne génèrent pas de bonus en KCS, mais les dettes oui.",
