  "assets.por.audit.intro.info": "À {auditTime} (UTC + 8) les actifs sont cryptés et intégrés dans un arbre de Merkle. Les données relatives aux actifs du compte actuel constituent la feuille de Merkle. Tant que la racine de Merkle reste inchangée, les actifs correspondant à la feuille de Merkle ne peuvent pas être altérés.",
