  "assets.por.audit.verify.content1": "Notez que des facteurs tels que l'heure de l'instantané et 资产统计口径 entraîneront des différences avec les actifs de votre compte actuel.",
  "assets.por.audit.verify.content2": "Vérification réussie. Ses actifs sont stockés en toute sécurité et protégés. <br/>\n Comme tout le monde peut participer à la vérification, le montant total des actifs des utilisateurs sur la plateforme est fiable.",
