  "assetsBack.cs.airCoin.applyDes": "Veuillez consulter les détails de votre ordre. Une fois approuvé, nous vous informerons des frais de service applicables, qui seront déduits de votre compte de financement pour terminer le processus de recouvrement des actifs. <br>Si vos actifs ne peuvent pas être récupérés, ou si la raison de l’échec du dépôt n’était pas une erreur de votre part, aucuns frais ne seront appliqués. Si vous êtes d’accord avec ces conditions, cliquez sur Confirmer et nous procéderons à votre demande.",
  "assetsBack.cs.airCoin.reason1": "<span>Si le réseau blockchain de la cryptomonnaie déposée n'est pas supporté par {brandName}, ou <span class='{style}'>si la cryptomonnaie que vous avez déposée n'est pas listée ou délistée de {brandName}</span>, le dépôt ne sera pas crédité</span>.",
  "assetsBack.cs.airCoin.reason2": "<span>Pour la sécurité de vos fonds, <span class='{style}'>nous ne pouvons restituer votre dépôt à l’adresse blockchain d’origine qu’une fois qu’il est approuvé, et le TxID du remboursement sera fourni. Si vous avez des circonstances particulières, veuillez contacter notre service client officiel à l'adresse support@kucoin.com</span>. Si l’adresse source du dépôt est une autre plateforme, veuillez contacter la plateforme en question pour les prochaines étapes une fois que nous aurons terminé le remboursement de notre côté</span>.",
