  "assetsBack.form.tips1": "Pour la sécurité de vos fonds, <span class='{style}'>nous ne pouvons retourner vos fonds déposés qu'à l'adresse du bloc source sans mémos, tags ou messages.</span> Si l'adresse source du dépôt est détenue par une plateforme, contactez cette plateforme pour une assistance supplémentaire après que KuCoin ait retourné vos fonds. En cas de circonstances particulières, contactez-nous à l'adresse support@kucoin.com.",
  "assetsBack.form.tips2": "Remarque : pour garantir la sécurité de vos actifs, nous ne pouvons renvoyer les fonds reçus qu'à l'adresse de provenance du dépôt (c'est-à-dire l'adresse à partir de laquelle les fonds ont initialement été envoyés). Si vous avez des circonstances particulières, veuillez contacter le service client via le mail support@kucoin.com. Si l'adresse de renvoi est un wallet connecté qui se trouve sur une autre plateforme, veuillez la contacter pour obtenir une assistance supplémentaire une fois le renvoi des fonds effectué de notre côté.",
  "assetsBack.form.tooltip1": "Dans le menu déroulant, sélectionnez le coin de dépôt. Si votre coin n'apparaît pas, saisissez-le manuellement.",
  "assetsBack.reason1": "Vous avez oublié de spécifier ou avez spécifié une mauvaise étiquette/memo lors du dépôt.",
  "assetsBack.reason1.confirmModelDes": "Confirmez que les informations contenues dans votre requête sont correctes. Une fois votre requête approuvée, nous vous communiquerons les frais correspondants à payer. Après le traitement de votre requête, nous vous fournirons le TxID du dépôt retourné.",
  "assetsBack.reason1.des1": "Pour certaines cryptomonnaies telles que XLM, EOS et XRP, un tag ou un memo doit être rempli pendant le processus de dépôt. Si vous n’entrez pas correctement l’adresse et le tag, le dépôt échouera.",
  "assetsBack.reason1.des2": "Pour la sécurité de vos fonds, <span class='{style}'>nous ne pouvons renvoyer les fonds déposés qu'à l'adresse du bloc source sans mémos, tags ou messages. Le TxID des fonds renvoyés sera fourni.</span> Si l’adresse source du dépôt appartient à une autre plateforme, vous devrez les contacter pour une assistance supplémentaire une fois que nous aurons effectué le renvoi des fonds de notre côté. Si vous avez des circonstances particulières, contactez-nous via mail à l'adresse support@kucoin.com.",
  "assetsBack.reason1.des3": "Si vous avez accidentellement spécifié un tag ou un memo appartenant à un autre utilisateur, vos fonds ont peut-être été déposés sur son compte. Dans de tels cas, malheureusement, nous ne sommes pas en mesure de fournir une aide supplémentaire.",
