  "beginnerZone.rule.item1": "1. L'événement commence le {date} et dure pour un temps limité.",
  "beginnerZone.rule.item2": "2. Inscrivez-vous pour une boîte mystère et gagnez jusqu'à {num1} USDT. Seuls les nouveaux utilisateurs qui se sont inscrits avec succès sur {brandName} pendant l'événement sont éligibles. Après s'être inscrits, les nouveaux utilisateurs reçoivent une chance de gagner une boîte mystère d'une valeur maximale de {num2} USDT.",
  "beginnerZone.rule.item3": "3. Effectuez votre premier dépôt/achat de cryptos et gagnez jusqu'à {num1} USDT. Seuls les utilisateurs qui n'ont jamais déposé ou acheté de crypto sur {brandName} avant l'événement sont éligibles. Les utilisateurs dont le premier dépôt/achat de cryptos est d'une valeur de {num2} USD ou plus (les dépôts/Achats de tous les types de cryptomonnaies sont éligibles, le montant sera calculé sur la base du prix de la cryptomonnaie au moment du dépôt/achat) pourront participer au tirage au sort pour gagner une boîte mystère d'une valeur allant jusqu'à {num3} USDT.",
  "beginnerZone.rule.item4": "4. Les utilisateurs peuvent déposer ou acheter des cryptos via l'achat rapide, P2P, tierce partie, pour terminer un tache. Les paquets rouges et les fonds d'essai ne comptent pas.",
  "beginnerZone.rule.item5": "5. Effectuez votre premier trade et gagnez jusqu'à {num1} USD. Seuls les utilisateurs qui n'ont jamais tradé sur {brandName} avant l'événement sont éligibles. Les utilisateurs dont le premier trade est effectué pendant l'événement d'une valeur de {num2} USD ou plus seront éligibles au tirage au sort pour gagner deux boîtes mystères d'une valeur allant jusqu'à {num3} USD. Un volume de trading avec un taux de frais nul n'est pas pris en compte dans le cadre de cet événement.",
  "beginnerZone.rule.item6": "6. Les trades valides comprennent les trades de futures, les trades au comptant, les achats de produits {brandName} Earn, les trades effectués par des bots de trading et les trades sur marge. Les valeurs sont calculées en fonction du montant de la transaction au moment du placement de l'ordre.",
  "beginnerZone.rule.item7": "7. Un retard peut survenir pendant la mise à jour des données. Si les données n'ont pas été mises à jour, essayez de rafraîchir la page ou contactez le service client.",
  "beginnerZone.rule.item8": "8. Les récompenses sont généralement reçues dans un délai de {num} jours, mais des retards peuvent survenir. Lorsque vous utilisez un bon de réduction de monnaie fiduciaire, le montant déduit vous sera remboursé après avoir placé un ordre.",
  "beginnerZone.rule.item9": "9. Les récompenses contenues dans les boîtes mystères peuvent comprendre : des bons de réduction de futures, des fonds d'essai de futures, des bons Rate-Up, des bons de réduction de monnaies fiduciaires, des hot coins, des bons de remboursement de frais de trading, des bonus sur marge, des bons sans intérêt et bien d'autres !",
