  "beginnerZone.rule.other.item3": "3. Pendant cet événement, les valeurs en USD des dépôts et des trades sont calculées en utilisant les taux de change en temps réel.",
  "beginnerZone.rule.other.item4": "4. {brandName} se réserve le droit de disqualifier et de révoquer les récompenses de tout participant reconnu coupable de se livrer à des activités frauduleuses ou illégales.",
  "beginnerZone.rule.other.item5": "5. {brandName} se réserve le droit d'annuler cet événement, de le modifier ou de changer ses règles.",
  "beginnerZone.rule.other.item6": "6. Tous les participants doivent se conformer strictement aux Conditions d'utilisation de {brandName}.",
  "beginnerZone.rule.other.item7": "7. {brandName} se réserve tous les droits sur l'interprétation finale de l'événement. Si vous avez des questions, contactez le service client.",
