  "creator.fifth.step2.sub1": "Vous pouvez créer du contenu sous n'importe quelle forme, y compris, mais sans s'y limiter, des vidéos, des articles, des infographies, des photos et des podcasts. Si vous avez d'autres idées intéressantes, n'hésitez pas à nous en faire part.",
  "creator.fifth.step2.sub2": "Assurez-vous de vérifier les règles et les exigences relatives aux sujets que vous avez choisis avant de créer le contenu. Assurez-vous de consulter nos <span>conseils</span> pour affiner votre contenu.",
