  "creator.fifth.step3.sub": "Publiez votre contenu sur les réseaux sociaux avec le hashtag #GetFreeBTCwith{brandName}.",
  "creator.fifth.step3.title": "Publiez votre contenu et partagez-le",
  "creator.fifth.step4.sub1": "Après avoir passé l'étape 3, soumettez votre contenu en remplissant toutes les informations du formulaire de soumission.",
  "creator.fifth.step4.sub2": "Veillez à effectuer toutes les étapes et à soumettre votre travail avant le dernier jour de chaque mois. Si vous ne le faites pas, vous ne pourrez pas prétendre à une récompense.",
  "creator.fifth.step4.title": "Soumettez votre contenu",
  "creator.fifth.step5.sub1": "{brandName} évaluera votre contenu sur la base de sa qualité globale et de son impact.",
  "creator.fifth.step5.sub2": "Les personnes ayant gagné les récompenses seront informées par e-mail avant le 10 du mois suivant.",
