  "creator.ninth.item5.title": "Plagiat",
  "creator.ninth.item6.sub": "En participant à ce programme, vous acceptez de transférer les droits d'auteur de vos œuvres ou contenus à {brandName}. {brandName} se réserve tous les droits de réviser les règles de ce programme.",
  "creator.ninth.item6.title": "Révisions des règles",
  "creator.ninth.title": "Conditions d'utilisation",
  "creator.second.btn": "Soumettez du contenu",
  "creator.second.sub": "{brandName} est en quête de créateurs de contenu talentueux pour proposer des contenus de haute qualité. Les meilleurs créateurs pourront gagner des BTC chaque mois. Commencez à monétiser votre créativité dès MAINTENANT !",
  "creator.second.title": "Gagnez des bitcoins grâce à votre créativité",
  "creator.seventh.item1.sub": "Toute personne passionnée par les crypto et la création de contenu est invitée à rejoindre le programme pour recevoir gratuitement des récompenses en bitcoins en échange de sa contribution.",
  "creator.seventh.item1.title": "Qui peut participer au programme {brandName} pour créateurs de contenu ?",
  "creator.seventh.item2.sub": "Oui, c'est tout à fait possible. Notre programme de créateurs de contenu est indépendant des programmes de parrainage et d'affiliation. Cependant, vous n'êtes pas autorisé à participer à ce programme en présentant un contenu déjà utilisé dans le cadre d'un autre programme.",
  "creator.seventh.item2.title": "Puis-je rejoindre ce programme si je suis déjà inscrit au programme de parrainage ou d'affiliation de {brandName} ?",
  "creator.seventh.item3.sub": "Votre travail sera évalué en fonction de facteurs tels que la qualité, la créativité et l'influence. Veuillez consulter la section <span>Conseils pour la création de contenu</span> pour obtenir de plus amples informations.",
  "creator.seventh.item3.title": "Sur quels critères mon contenu sera-t-il évalué ?",
  "creator.seventh.item4.sub": "Vous recevrez vos récompenses en bitcoins le 15 du mois suivant l'événement.",
  "creator.seventh.item4.title": "Si je gagne des récompenses, quand vais-je les recevoir ?",
  "creator.seventh.item5.sub": "Pour voir vos récompenses en bitcoins, consultez votre compte de financement sur la page des actifs.",
  "creator.seventh.item5.title": "Comment consulter mes récompenses en bitcoins ?",
