  "creator.sixth.item1.sub1": "Chaque mois, {brandName} sélectionnera le meilleur créateur pour chaque langue.",
  "creator.sixth.item1.sub2": "Celui-ci recevra une prime supplémentaire en bitcoins.",
  "creator.sixth.item1.title": "Prime du meilleur créateur",
  "creator.sixth.item2.sub": "Les meilleurs créateurs auront la possibilité d'être présentés sur les réseaux sociaux officiels de {brandName}.",
  "creator.sixth.item2.title": "Créateurs mis en vedette",
  "creator.sixth.item3.sub": "Les meilleurs créateurs de contenu auront la possibilité de devenir des créateurs certifiés de {brandName}. Ils ou elles pourront ainsi travailler à long terme comme contributeurs sur les contenus et les blogs de {brandName}.",
  "creator.sixth.item3.title": "Devenir créateur certifié {brandName}",
  "creator.sixth.title": "Autres primes accordées aux créateurs",
  "creator.third.li1": "Chaque mois, le programme prévoit un événement portant sur différents sujets qui seront proposés aux créateurs. Ces derniers pourront sélectionner les sujets qui les intéressent et proposer du contenu à {brandName}. Chaque contenu retenu par {brandName} se verra récompensé en bitcoins d'une valeur de 500 $.",
