  "ePUBvxK9udnMJNg6hoSLnL": "Lorsqu’un mineur apporte sa puissance de calcul à BTC.com et qu’il mine avec succès un bloc de Bitcoin, il recevra 98,5 % de la récompense du bloc. BTC.com, à son tour, retient 1,5 % de frais pour avoir fourni le pool de minage.",
