  "eo9gCQgXyPVRAaRjaogwGM": "<span>Préservez la confidentialité de vos clés privées :</span> ne partagez jamais vos clés privées ou votre phrase secrète avec qui que ce soit. C’est le seul moyen d’accéder à vos fonds, de sorte que toute personne disposant de ces informations peut prendre le contrôle de vos actifs.",
  "epNPKW7zYLin57RYMRmnhp": "Une fois la résiliation initiée, la partie des actifs qui n'a pas encore été prêtée sera immédiatement créditée sur votre compte, tandis que la partie des actifs qui a été prêtée sera créditée sur votre compte au début de l'heure suivante.",
  "esGycbivL8m6GPuHD8q9Y8": "Quelle est la prévision de prix de l'ETH après Ethereum 2.0 ?",
  "estimated": "Montant estimé",
  "etf.action.redeem": "Remboursement",
  "etf.action.subscribe": "Souscrire",
  "etf.action.toTrade": "Trade",
  "etf.answer.five.content1": "i. Frais de trading : ces frais sont prélevés lors de l'achat/la vente des jetons à effet de levier sur le marché au comptant. Le niveau des frais est le même que celui du trading au comptant.",
  "etf.answer.five.content2": "ii. Frais de souscription : ils sont facturés lors de toute souscription à un jeton à effet de levier. La commission est actuellement de {feeRate} % du montant de chaque souscription.",
  "etf.answer.five.content3": "iii. Frais de résiliation : ils sont perçus lors du rachat d'un jeton à effet de levier. Les frais s'élèvent actuellement à {feeRate} % du montant de chaque résiliation.",
  "etf.answer.five.content4": "iv. Frais de gestion : ils sont débités chaque jour à 7 h 45 (UTC+2) au taux de {managementFees} %. Les frais sont inclus dans la valeur nette des jetons à effet de levier et sont sans incidence sur vos avoirs. Les frais de gestion étant prélevés automatiquement chaque jour, les traders doivent faire preuve de prudence lorsqu'ils envisagent de détenir des jetons à effet de levier sur le long terme.",
  "etf.answer.five.tilte": "Les frais encourus avec les jetons {brandName} à effet de levier sont les suivants :",
  "etf.answer.one": "Les jetons à effet de levier {brandName} sont des actifs utilisés en trading sur le marché au comptant de {brandName} qui tirent parti des bénéfices en achetant / vendant sur l'actif sous-jacent. Par exemple, lorsque le prix du BTC augmente de 1%, le BTC3L augmentera de 3% tandis que le BTC3S baissera de 3%. Contrairement au trading sur marge ou au trading de futures, la détention des jetons à effet de levier ne nécessite aucune garantie ni maintien de la marge, et il n'y a aucun risque de liquidation. Cependant, il peut y avoir une forte volatilité dans le prix des jetons à effet de levier, donc soyez prudent de votre investissement.",
  "etf.answer.six.content1": "i. Le marché des jetons à effet de levier présente des risques et des incertitudes plus élevés que le marché au comptant. La détention de jetons à effet de levier peut générer de nombreux profits, mais aussi de lourdes pertes au cours d'une journée.",
  "etf.answer.six.content2": "ii. Le mécanisme de rééquilibrage et les frais de gestion signifient que plus vous détenez un jeton à effet de levier, plus les frais que vous devez payer sont élevés. Les traders doivent faire preuve de prudence lorsqu'ils détiennent des jetons à effet de levier sur le long terme.",
  "etf.answer.step1.content": "Vous pouvez trader les jetons à effet de levier sur le marché au comptant de {brandName}. Accédez à la page des jetons à effet de levier et recherchez ceux que vous préférez, puis cliquez sur \"Trade\" pour acheter ou vendre.",
  "etf.answer.step1.title": "i. Le marché au comptant {brandName} (recommandé)",
  "etf.answer.step2.content": "{brandName} traite les demandes de souscription et de résiliation à {unifiedSubmissionTimePoints} chaque jour. Les prix de souscription/rachat sont déterminés par ceux de l'exécution, il y a donc des incertitudes sur le temps et le prix. Ainsi, veuillez faire preuve de prudence dans vos décisions de trading.",
  "etf.answer.step2.title": "ii. Souscription/Résiliation",
  "etf.answer.three": "En raison du mécanisme de rééquilibrage, les jetons à effet de levier de {brandName} constituent un bon choix pour les mouvements unilatéraux du marché, mais un mauvais choix pour les marchés fluctuants. Lorsque la volatilité est élevée, les pertes en cours de journée peuvent être plus importantes. Les traders doivent être prudents lorsqu'ils investissent.",
  "etf.answer.two": "Chaque jeton à effet de levier de {brandName} est une part unitaire d'un fonds à effet de levier. Le gestionnaire du fonds s'assure que les rendements du fonds sont basés sur un multiple spécifique de l'actif sous-jacent et que les traders peuvent gagner ce multiple spécifique de bénéfices de l'actif sous-jacent. Lorsque la volatilité du prix du côté opposé dépasse le seuil, un mécanisme de rééquilibrage est utilisé pour couvrir les risques afin de contrôler la perte nette.",
  "etf.apply.alert": "<div>Le traitement quotidien a lieu à {unifiedSubmissionTimePoints}. Les prix de souscription et de résiliation sont basés sur la dernière transaction effectuée. </div> <div>Pour réduire tout risque ou toute incertitude, nous recommandons d'utiliser le trading au comptant.</div> <div class='tip'>Remarque : lors d'une souscription ou d'une réclamation, vos actifs seront toujours crédités à la prochaine heure de traitement prévue.</div>",
