  "f04f212c6c864000ab3f": "Nous sauvegardons régulièrement les données pour assurer une récupération rapide en cas de perte ou d’endommagement.",
  "f0c3a38dc9884000a01b": "Les nouveaux jetons ajoutés à l’épargne de KuCoin auront l'Auto Earn activé.",
  "f13dde558c1e4000a40b": "Sécurité du système",
  "f28d189c4db14000a9ab": "Développement sécurisé",
  "f2b84adc997e4000a9b4": "Nos réserves sont réparties entre des portefeuilles froids, tièdes et chauds, la majorité des actifs étant stockés dans des portefeuilles froids qui ne sont pas accessibles directement depuis Internet, minimisant ainsi les risques et protégeant les fonds des utilisateurs.",
  "f2e4a9a1d64e4000a1a0": "Précédent :",
  "f3b1d516d30b4000abd0": "Sommaire",
  "f3befe03e4364000a82e": "L'authentification multifactorielle (MFA) est une mesure simple et efficace qui ajoute une couche supplémentaire de protection. Lorsqu'elle est activée, vous effectuez un deuxième type de vérification en plus de la saisie de votre nom d'utilisateur et de votre mot de passe.\n\n{brandName} utilise plusieurs méthodes MFA, y compris des codes de vérification par e-mail, SMS et depuis Google Authenticator. De plus, notre application offre des options d'authentification biométrique telles que l'empreinte digitale et la reconnaissance faciale pour vérifier votre identité rapidement et en toute sécurité.\n\nSi la sécurité du système détecte des anomalies dans l'appareil et l'adresse IP utilisés pour se connecter à votre compte, ou si elle juge que vos actions récentes présentent un risque élevé pour la sécurité de votre compte, des liens vers des e-mails seront utilisés pour renforcer la vérification. Cela permet d'éviter les violations de compte dues aux attaques d'hameçonnage, à la fraude télécom et à d'autres menaces.",
  "f47b94ef147c4000a250": "Disponible + Investi (USDT)",
  "f5B3R5EgXkkHdXBGHyJ8Rm": "Saisir votre UID",
  "f5Zge54Cj2Ntd1RrAMMfCG": "Le minage de cryptomonnaies est crucial pour les réseaux de blockchain et utilise à la fois du matériel et des logiciels pour résoudre des problèmes mathématiques afin de récompenser les mineurs en cryptos. Dans ce guide, comprenez les avantages, les risques, les types et la rentabilité du cloud mining, et comment éviter les escroqueries.",
  "f6a0c27b7fe04000a1e2": "{brandName} utilise des pare-feu d’applications Web (WAF) pour intercepter et protéger les applications clés contre différents types d’attaques d’applications Web.",
  "f6c3cbe6a2ef4000a8f1": "1. Le système vous permet de souscrire à des produits d’épargne pour les monnaies que vous avez sélectionnées avec les soldes disponibles sur votre compte de financement. Cela se produit tous les jours à 1 h 00 (UTC).",
  "f6fe83efb3fe4000a80e": "Une phrase anti-hameçonnage permet d’éviter les attaques de phishing. Ce code peut être configuré dans vos paramètres d’e-mail, de connexion et de retrait. En vérifiant si le code s’affiche lors de la connexion, les utilisateurs peuvent vérifier si le site internet est authentique ou s’il s’agit d’un site de phishing. Si vous soupçonnez un site d’hameçonnage, vous devez le quitter immédiatement et modifier vos paramètres de sécurité pour protéger votre compte.",
  "f919f92814284000a58e": "Isolation des données sensibles avec des bases de données dédiées et la conteneurisation",
  "f9bea9fe0aa84000a87c": "Taux d’intérêt : {coin1} à {apr1}, {coin2} à {apr2}, et {coin3} à {apr3}.",
  "f9f491b5cdfc4000a0f4": "Suivant :",
