  "fPoz13ans9Sg2oT2t2JU6z": "Retraits gelés",
  "fQjMAkUAQSfPs29m44gwYz": "<span>Pratiquer, apprendre et gérer les attentes :</span> commencez par utiliser un compte test comme outil d'apprentissage du copy trading. Utilisez-le pour connaître les tendances du marché, comprendre que le trading comporte des risques et gérer vos attentes en conséquence. Soyez conscient de tous les autres coûts liés et interagissez avec la communauté de la plateforme pour obtenir des informations et partager vos expériences.",
