  "rA9EKXzZbGVeKnkiStoZrw": "Continuer",
  "rATLHGpwYqQW1yfh7Rrw2B": "Le halving du Bitcoin n’affecte pas directement ses vitesses de transaction. La vitesse de transaction est principalement déterminée par des facteurs tels que la taille des blocs et la congestion du réseau actuel. Bien que certains affirment qu’une diminution des récompenses des mineurs pourrait entraîner une diminution de la concurrence pour l’espace de blocs, ce qui pourrait avoir un impact sur la vitesse, cette finalité n'étant pas garantie.",
