  "aboutus.roadmap.2023.q3": "<p>{brandName} lance le <b>Marché de trading de gré à gré</b>, le premier produit de gré à gré du secteur</p><p>{brandName} lance la <b>Stratégie de marge</b>, une nouvelle stratégie de bot de trading sur marge</p>",
  "aboutus.roadmap.2023.q4": "<p>{brandName} dévoile la <b>KuCard</b>, une carte crypto Visa qui ouvre la voie à l'avenir des paiements</p><p>{brandName} lance l'<b>IA de tendance spot</b>, une nouvelle stratégie de bot de trading au comptant</p>",
  "aboutus.roadmap.2024.q1": "<p><b>KuCard x Apple Pay</b> : la carte crypto Visa de {brandName} est désormais compatible avec Apple Pay</p><p><b>Leadership réglementaire en Inde</b>{brandName} est un pionnier en matière de conformité parmi les plateformes d'échanges de crypto de premier plan</p><p>{brandName} lance <b>Martingale futures</b>, une nouvelle stratégie pour les bots de trading de futures</p>",
  "aboutus.roadmap.2024.q2": "<p>{brandName} lance GemSlot et GemPool pour les listings de jetons</p><p>{brandName} lance l'<b>IA de tendance futures</b>, une nouvelle stratégie de bot de trading sur les marchés futures</p><p>{brandName} Futures lance les ordres limite avancés, offrant aux utilisateurs une plus grande flexibilité de trading</p>",
  "aboutus.roadmap.2024.q3": "<p>{brandName} fête ses 7 ans : \"7rust {brandName}, Own Your Future\" (\"Prenez votre avenir en main\")</p><p>{brandName} Futures lance la <b>Marge croisée</b>, le système de marge croisée, qui améliore l'efficacité du capital</p><p><b>Auto-Earn</b> : une fonction qui permet de souscrire facilement des fonds inutilisés à l'épargne flexible pour obtenir des rendements stables</p><p><b>Earn intelligent</b> : un outil de {brandName} Earn offrant des recommandations personnalisées basées sur les préférences et les niveaux de risque</p><p><b>Améliorations du bot de trading</b> : une interface utilisateur remaniée et de nouveaux modes pour le bot de trading, comprenant 12 stratégies automatisées pour diverses conditions de marché</p><p></p>",
  "aboutus.roadmap.2024.q4": "<p>{brandName} lance le <b>Trading d'options</b>, des stratégies de trading et des outils de gestion des risques élargis</p><p>{brandName} lance <b>Avantages futures</b>, une interface dédiée avec des promotions exclusives pour les traders de contrats futures</p><p>{brandName} lance <b>Copy trading de futures</b>, qui permet de reproduire une stratégie en direct, intégrant les transactions du trader référent</p><p><b>Actualités flash</b> : un flux d'informations alimenté par l'IA pour une meilleure compréhension du marché</p><p><b>Recherche {brandName}</b> : un nouveau centre de ressources pour l'analyse de l'industrie et les rapports de projet</p><p><b>{brandName} Apprendre et gagner</b> : un moyen interactif de gagner de la crypto gratuitement grâce à l'apprentissage</p>",
  "aboutus.roadmap.2025.q1": "<p><b>{brandName} Pay</b> : une solution pour des paiements crypto transparents</p><p><b>Actualités {brandName}</b> : mises à jour du marché en direct sur Bitcoin, les altcoins et les développements du Web3</p>",
  "b312de5446da4000a722": "Réclamation d'actifs",
  "bca93a8787b24000a4c8": "Les autorisations de trading pour ce sous-compte ne sont pas activées. Connectez-vous à votre compte principal pour modifier les autorisations de sous-compte.",
  "02088f2422e94000a3eb": "Infrastructures décentralisées",
  "026968b084d24000a02b": "Avantages de l'écosystème KCS",
  "05e3c1d361f74000abe8": "Métavers de jeux sociaux",
  "087f119ac6bd4000aa0d": "TRGC est un fonds d'actifs numériques dédié à l'investissement dans les opportunités de transformation qui conduisent au prochain changement de paradigme de l'internet.",
  "0df6bb1fff2e4000af72": "Bénéficiez de frais réduits, de récompenses exclusives et d'une participation directe dans l'avenir de KuCoin grâce à notre écosystème KCS florissant.",
  "185af89739e74000aace": "Rejoignez une communauté mondiale dynamique qui se nourrit de collaboration, d'innovation et d'inclusion financière.",
  "23a3d14b6cf34000a882": "Contactez-nous.",
  "24e8b825a97b4000a553": "Nos avantages",
  "288ee3f258534000a134": "KuCoin Ventures investit et soutient des projets blockchain innovants dans des secteurs tels que l’infrastructure, la DeFi, les NFT et la SocialFi, alimentant ainsi la croissance continue de l’écosystème Web3.",
  "2bc2d33b535b4000ac09": "Nous évoluons en permanence pour répondre aux besoins des traders modernes, en offrant des outils de pointe et une expérience de trading transparente.",
  "2ecd9e9b835f4000af50": "Infrastructure d'interopérabilité Web3",
  "3a1d43481cdb4000a587": "Email",
  "3ccc4f64a7ab4000a0e2": "En tant qu’investisseur axé sur la communauté et la recherche, KuCoin Ventures collabore étroitement avec les projets contenus dans son portefeuille tout au long de leur cycle de vie, en se spécialisant dans les infrastructures DeFi, GameFi et Web3.",
  "3ced5ea1db9f4000af5b": "Rollup ZK décentralisé, équivalent à Ethereum",
  "4e0b5341981e4000a9af": "La sécurité avant tout",
  "581fedf360194000a8ec": "OS décentralisé",
  "59faeed1a8cf4000a094": "Abstraction de chaîne sans portefeuille L1",
  "5bd44eada21d4000ae67": "KuCoin Ventures soutient les créateurs de crypto et de Web3 à la fois financièrement et stratégiquement, en offrant une vision approfondie et en tirant parti des ressources mondiales",
  "5d01bcc193c54000a0c1": "Voir les postes ouverts",
  "5d0321509ade4000afe7": "Plateforme d'échange décentralisée tout-en-un",
  "5eedfcd04c8e4000a152": "Trading innovant",
  "639afd5beda54000a272": "Unir nos forces pour façonner l’avenir",
  "64f878358ab64000a8d0": "Incubateur Web3",
  "67f9cb69ac0e4000a169": "Rejoignez KuCoin et faites partie d’un avenir fondé sur la transparence, l’intégrité et la passion.",
  "6a1ac3fe9f8f4000ab62": "Devenir une entreprise technologique respectée dans le monde entier, qui stimule l'innovation dans le secteur des cryptos.",
  "6ea33259dec64000a53d": "Systèmes sociaux Web3",
  "7524379504f44000ac34": "Permettre la <span class='hl-text'>libre circulation <br/> de la valeur numérique dans le monde</span>",
  "7762b1cabbcf4000a1cd": "Votre sécurité est notre priorité absolue. Nous protégeons vos actifs grâce à une protection de pointe, ce qui vous garantit une totale tranquillité d'esprit.",
  "7b43d074282b4000a338": "Tout a commencé avec Michael, un programmeur passionné qui a commencé à l’âge de 8 ans et a lancé sa première startup à 16 ans. En 2012, il a découvert Bitcoin par l’intermédiaire de son patron, Eric, et les deux ont plongé la tête la première dans le monde du minage. Cependant, lorsque Michael a tenté de vendre des BTC sur Mt. Gox, la plus grande plateforme de l’époque, il s’est rapidement rendu compte à quel point le trading de cryptomonnaies était difficile et inaccessible pour les nouveaux arrivants, malgré son immense potentiel à remodeler le paysage financier.",
  "7d7838da36ea4000a98c": "Boutique d'applications crypto multi-chaînes Web3",
  "7fa0d0df97424000a257": "La blockchain optimisée pour les joueurs",
  "86f4b83859364000aaa7": "Appli SocialFi",
  "8891a013712e4000a472": "À mesure que l’adoption de la blockchain s’accélérait, Michael et Eric ont constaté son pouvoir de transformation, non seulement pour les riches, mais pour tout le monde, y compris les personnes non bancarisées et mal desservies. Fin 2013, ils se sont assis dans un café et ont écrit les premières lignes de code de ce qui allait devenir KuCoin, l'Exchange du peuple, une plateforme conçue pour faire tomber les barrières et rendre la crypto accessible à tous.",
  "8eb597d442274000a1ee": "Marché monétaire de l'écosystème SUI",
